// モジュール定義
module ModuleA #( param ParamA: u32 = 10, local ParamB: u32 = 10, // 末尾カンマが可能です
) ( i_clk : input clock , // `clock` はクロックのための特別な型です i_rst : input reset , // `reset` はリセットのための特別な型です i_sel : input logic , i_data: input logic<ParamA> [2], // `[]` は SystemVerilog のアンパック配列です o_data: output logic<ParamA> , // `<>` は SystemVerilog のパック配列です
) { // ローカルパラメータ宣言 // モジュール内では `param` は使えません local ParamC: u32 = 10; // 変数宣言 var r_data0: logic<ParamA>; var r_data1: logic<ParamA>; var r_data2: logic<ParamA>; // 値の束縛 let _w_data2: logic<ParamA> = i_data; // リセット付き always_ff 文 // `always_ff` はクロック（必須）とリセット（オプション）を持ちます // `if_reset` は `if (i_rst)` を意味し、リセット極性を隠蔽するための構文です // `if` 文に `()` はいりません // `always_ff` 内の `=` はノンブロッキング代入です always_ff (i_clk, i_rst) { if_reset { r_data0 = 0; } else if i_sel { r_data0 = i_data[0]; } else { r_data0 = i_data[1]; } } // リセットなし always_ff 文 always_ff (i_clk) { r_data1 = r_data0; } // モジュール内にクロックとリセットが1つしかない場合 // クロックとリセットの指定は省略できます always_ff { r_data2 = r_data1; } assign o_data = r_data1;
}

